INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("青空の下で謁見", 7, 8, 2, 2834, 40, 1, 5118061, 20063115, 0, 10118, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "ペコリーヌとの出会い", 91002, "フリーマーケット会場");
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("未来の騎空団\nマスコット？", 7, 8, 2, 2835, 40, 1, 5118062, 20063115, 0, 10118, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "マホとの出会い", 91002, "フリーマーケット会場");
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("お嬢さまからの\n緊急依頼", 7, 8, 2, 2837, 40, 1, 5118063, 20063115, 0, 10118, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "アキノとの出会い", 91002, "ランドソル市街地");
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("黄金色の悩みごと", 18, 8, 2, 4108402, 40, 1, 5118064, 20063115, 0, 10118, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "ジュンとの出会い", 91002, "フリーマーケット会場");
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("白熱！　格闘大会！", 18, 8, 2, 4107402, 40, 1, 5118065, 20063115, 0, 10118, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "カオリとの出会い", 91002, "フリーマーケット会場");
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("祭り太鼓はオーエドの華", 16, 8, 2, 9000227, 40, 1, 5118066, 20063115, 1, 10118, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "ニノンとの出会い", 91002, "オーエド町");
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("人気者は遅れて\nやってくる", 19, 8, 3, 2101181, 40, 1, 5118067, 20063115, 0, 10118, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "スズナとの出会い", 91002, "フリーマーケット会場");
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("巫女・ミーツ・魔法少女", 18, 8, 3, 4109402, 40, 1, 5118068, 20063115, 0, 10118, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ナナカとの出会い", 91002, "ランドソル市街地");
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("ネズ耳は二度なくなる", 18, 8, 3, 4305402, 40, 1, 5118069, 20063115, 0, 10118, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "キャル＆コッコロとの出会い", 91002, "フリーマーケット会場");
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("この出会いにカンパイ！", 18, 8, 3, 4101402, 40, 1, 5118070, 20063115, 0, 10118, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ユカリとの出会い", 91002, "ランドソル市街地");
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("陰陽アンサンブル", 18, 8, 3, 4106402, 40, 1, 5118071, 20063115, 0, 10118, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "アオイとの出会い", 91002, "ランドソル市街地");
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("運試し十番勝負！", 7, 8, 3, 2836, 40, 1, 5118072, 20063115, 1, 10118, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "シノブとの出会い", 91002, "フリーマーケット会場");
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("彼女たちの新たな日常", 0, 0, 1, 0, 0, 0, 5118600, 20063115, 0, 10118, 0, "オープニング", 0, 0);
